import React from "react";
import {NaLink} from "react-router-dom";
import './index.css';
const Navbar=()=>{
  return(
    <>
    <NaLink exact activeClassName="liko" to='about'>About </NaLink>
    <NaLink exact activeClassName="liko" to='Contact'> Contact </NaLink>
    </>
  )
}
export default Navbar;
